import React from 'react';

import { WrapBonusPanel, Borderline } from './style';

export default ({ meta }) => {
  return (
    <WrapBonusPanel>
      <div className="bonus_title">加分詳情</div>
      <section>
        <div>
          <span>階段四</span> <span>+{meta.s4 || 0}</span>
        </div>
        <div>
          <span>Round 2</span> <span>+{meta.r2 || 0}</span>
        </div>
      </section>
      <Borderline />
    </WrapBonusPanel>
  );
};
